CREATE TABLE `users` (
  `email` varchar(255) DEFAULT NULL,
  `password_hash` varchar(255) NOT NULL,
  `role` varchar(25) NOT NULL,
  `mfa_enabled` tinyint(1) NOT NULL,
  `mfa_secret` varchar(100) DEFAULT NULL,
  `mfa_recovery_codes` json DEFAULT NULL,
  `last_login` datetime DEFAULT NULL,
  `disabled` tinyint(1) NOT NULL,
  `id` varchar(40) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `is_active` tinyint(1) NOT NULL,
  `store_id` varchar(40) DEFAULT NULL,
  `full_name` varchar(150) DEFAULT NULL,
  `is_first_login` tinyint(1) NOT NULL,
  `password_reset_required` tinyint(1) NOT NULL,
  `must_change_password` tinyint(1) NOT NULL,
  `location` varchar(122) DEFAULT NULL,
  `mobile_number` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ix_users_email` (`email`),
  UNIQUE KEY `mobile_number` (`mobile_number`),
  KEY `ix_users_id` (`id`),
  KEY `store_id` (`store_id`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`store_id`) REFERENCES `stores` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
